import React, { useState } from 'react';
import './App.css';

const FormularioDiagnostico = () => {
  const [inputs, setInputs] = useState({ H2: '', CH4: '', C2H2: '', C2H4: '', C2H6: '' });
  const [resultado, setResultado] = useState(null);

  const handleChange = e => {
    setInputs({ ...inputs, [e.target.name]: e.target.value });
  };

  const diagnosticar = async e => {
    e.preventDefault();
    const res = await fetch('http://localhost:8000/diagnostico', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({
        H2: parseFloat(inputs.H2),
        CH4: parseFloat(inputs.CH4),
        C2H2: parseFloat(inputs.C2H2),
        C2H4: parseFloat(inputs.C2H4),
        C2H6: parseFloat(inputs.C2H6)
      })
    });
    const data = await res.json();
    setResultado(data);
  };

  return (
    <div style={styles.container}>
      
      <div style={styles.formDiv}>
        <form style={styles.formulario} onSubmit={diagnosticar}>
          <h2 style={styles.titulo}>Diagnóstico de transformadores <br/> de portência por DGA</h2>

          <div style={styles.conjunto}>
            <div style={styles.campo}>
              <label style={styles.label}>H2 (ppm):</label>
              <div style={styles.divInput}>
                <input
                  type="number"
                  name={'H2'}
                  value={inputs['H2']}
                  onChange={handleChange}
                  required
                  style={styles.input}
                />
              </div>
            </div>

            <div style={styles.campo}>
              <label style={styles.label}>CH4 (ppm):</label>
              <div style={styles.divInput}>
                <input
                  type="number"
                  name={'CH4'}
                  value={inputs['CH4']}
                  onChange={handleChange}
                  required
                  style={styles.input}
                />
              </div>
            </div>
          </div>

           
          <div style={styles.conjunto}> 
              <div style={styles.campo}>
                <label style={styles.label}>C2H2 (ppm):</label>
                <input
                  type="number"
                  name={'C2H2'}
                  value={inputs['C2H2']}
                  onChange={handleChange}
                  required
                  style={styles.input}
                />
              </div>
          
              <div style={styles.campo}>
                <label style={styles.label}>C2H4 (ppm):</label>
                <input
                  type="number"
                  name={'C2H4'}
                  value={inputs['C2H4']}
                  onChange={handleChange}
                  required
                  style={styles.input}
                />
              </div>
          </div>
          
          <div style={styles.sozinho}>
             <div style={styles.campo}>
              <label style={styles.label}>C2H6 (ppm):</label>
              <div style={styles.divInput}>
                <input
                  type="number"
                  name={'C2H6'}
                  value={inputs['C2H6']}
                  onChange={handleChange}
                  required
                  style={styles.input}
                />
            </div>
          </div>
          </div>

          <div style={styles.divBotao}>
              <button type="submit" style={styles.botao}>Diagnosticar</button>
          </div>
          
        </form>
      </div>
      

      {resultado && (
        <div style={styles.resultado}>
          <h4>Falha identificada:</h4>
          <p><strong>{resultado.falha}</strong></p>
        </div>
      )}
    </div>
  );
};

const styles = {
  container: {
    width: '100vw',
    height: '100vh',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    backgroundColor: 'black',
  },
  titulo: {
    textAlign: 'center',
    color: 'white',
    fontSize: 30,
    marginBottom: '2rem'
  },
  formDiv: {
    marginTop: '30px',
    backgroundImage: 'linear-gradient(90deg, #9572FC 0%, #43E7AD 50.52%, #E2D45C 100%)',
    paddingTop: '4px',
    borderRadius: '10px',
    
  },
  formulario: {
    fontFamily: 'Inter sans-serif',
    backgroundColor: '#2A2634',
    padding: '25px',
    paddingTop: '24px',
    borderRadius: '8px',
    alignItems: 'center'
  },
  conjunto: {
    display: 'flex',
    flex: 'row',
  },
  sozinho: {
    paddingLeft: '115px',
  },
  campo: {
    margin: '0 auto',
    marginBottom: '15px'
  },
  label: {
    marginBottom: '6px',
    display: 'block',
    color: 'white',
    fontSize: 12,
    fontWeight: 'bold'
  },
  input: {
    width: '175px',
    height: '20px',
    borderRadius: '3px',
    padding: '6px',
    border: 'none',
    borderBottom: '1px solid #ccc',
    fontSize: '15px',
    outline: 'none'
  },
  divBotao: {
    paddingLeft: '50px'
  },
  botao: {
    backgroundColor: '#0077aa',
    width: '300px',
    color: '#fff',
    paddingTop: '15px',
    paddingBottom: '15px',
    border: 'none',
    borderRadius: '5px',
    fontSize: '23px',
    cursor: 'pointer',
    marginTop: '30px',
    marginBottom: '10px',
  },
  resultado: {
    marginTop: '2rem',
    background: '#e6f7ff',
    padding: '1.2rem',
    borderLeft: '6px solid #00aaff',
    borderRadius: '10px'
  }
};

export default FormularioDiagnostico;
